Software Testing using Visual Studio 2010 

Software Testing using Visual Studio 2010 /by Subashni S. Satheesh Kumar N. When testing your applications on the Microsoft platform, Visual Studio 2010 offers you a range of powerful tools for different types of testing. This Microsoft product makes the testing process easier and faster. A concise guide that will lead you through the amazing range of features offered by Visual Studio 2010 to test your software applications before going live.

It is packed with simple but interesting examples to make you comfortable with Visual Studio 2010 testing environment. The book introduces you to the main types of testing available in Visual Studio for both desktop and web applications, and then walks you through deploying, running, and interpreting the results of tests. Visual Studio 2010 is the new version of Microsoft's software development product, and includes lots of new features for developing and testing software applications. In collaboration with Team Foundation Server, it provides supporting tools for the management of the entire application life cycle, including development and testing

